let vLedNames = [
	"Logo", "Scroll"
];

let vLedPositions = [
	[1, 2], [1, 0],
];

let savedDpi1;

export function Initialize() {

	if(DpiControl) {
		setDpi(1, dpi1);

	}
}

export function LedNames() {
	return vLedNames;
}

export function LedPositions() {
	return vLedPositions;
}

export function Shutdown() {

	SendColorPacket(vLedPositions[0], 0, true);
	SendColorPacket(vLedPositions[1], 1, true);


}

export function Validate(endpoint) {
	return endpoint.interface === 0;
}

function SendColorPacket(Position, zone, shutdown = false) {
	let packet = [];
	let iPxX = Position[0];
	let iPxY = Position[1];
	let color;

	if(shutdown){
		color = hexToRgb(shutdownColor);
	}else if (LightingMode === "Forced") {
		color = hexToRgb(forcedColor);
	}else{
		color = device.color(iPxX, iPxY);
	}

	packet[0x00] = 0x00;
	packet[0x01] = 0x5B;
	packet[0x02] = 0x00;
	packet[0x03] = zone;
	packet[0x04] = 0x10;
	packet[0x05] = 0x27;
	packet[20] = 0x01;
	packet[28] = 0x01;
	packet[29] = color[0];
	packet[30] = color[1];
	packet[31] = color[2];
	packet[32] = color[0];
	packet[33] = color[1];
	packet[34] = color[2];

	device.send_report(packet, 263);
	device.pause(1);
}

export function Render() {

	SendColorPacket(vLedPositions[0], 0);
	SendColorPacket(vLedPositions[1], 1);

	if(savedDpi1 != dpi1 && DpiControl){
		setDpi(1, dpi1);
	}

	device.pause(1);
}

function setDpi(channel, dpi){
	savedDpi1 = dpi1;

	var packet = [];
	packet[0] = 0x00;
	packet[1] = 0x55;
	packet[2] = 0x00;
	packet[3] = channel;
	packet[4] = channel;
	packet[5] = (dpi/50);
	device.write(packet, 65);

	var packet = [0x00, 0x59];
	device.write(packet, 65);


}

function hexToRgb(hex) {
	let result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
	let colors = [];
	colors[0] = parseInt(result[1], 16);
	colors[1] = parseInt(result[2], 16);
	colors[2] = parseInt(result[3], 16);

	return colors;
}


